require 'benchmark'
def min_cost_paul(colors, needed_time)
  bufColorIndex = 0
  totalTime = 0
  for i in 1..colors.length do
    if (colors[bufColorIndex] == colors[i])
      if (needed_time[i] < needed_time[bufColorIndex])
          totalTime += needed_time[i]
      else
          totalTime += needed_time[bufColorIndex]
          bufColorIndex = i
      end
    else
       bufColorIndex = i
    end
  end
  return totalTime
end

