# @param {String} colors
# @param {Integer[]} needed_time
# @return {Integer}
def min_cost(colors, needed_time)
    total_time = 0
    i, j = 0, 0
    while i < needed_time.length && j < needed_time.length
      curr_total = 0
      curr_max = 0
      while j < needed_time.length && colors[i] == colors[j]
        curr_total += needed_time[j]
        curr_max = curr_max > needed_time[j] ? curr_max : needed_time[j]
        j += 1
      end
      total_time += curr_total - curr_max
      i = j
    end
    return total_time
end
